// Footer.js
import React from 'react';
import './Footer.css';
import logo from '../Images/logo.png'
import facebook from '../Images/facebook.png'
import linkedin from '../Images/linkedin.png'
import phone from '../Images/phone.png'
import email from '../Images/email.png'

function Footer() {
  return (
    <footer style={{ backgroundColor: '#29335C', textAlign: 'center', color: 'white' }}>
        <div id='footerBox'>
            <div id="footerP1">
                <div><img src={logo} width="70px" height='70px' alt="logo" /></div>
                <div id='mwmcBigFooter'>Midwest Math Circle 2023</div>
            </div>

            <div id='socials'>
                <div><img class='socialLogo' src={facebook} width="25px" height='25px' alt="logo" /></div>
                <div><img class='socialLogo' src={linkedin} width="25px" height='25px' alt="logo" /></div>
                <div><img class='socialLogo' src={phone} width="25px" height='25px' alt="logo" /></div>
                <div><img class='socialLogo' src={email} width="25px" height='25px' alt="logo" /></div>
            </div>

            <div id='copyright'>

            </div>
        </div>

         
    </footer>
  );
}

export default Footer;
